    <div>
      <div className="h_box">
        <div className="welcome-text">
          <h1>
            <span>Bienvenue</span>,
          </h1>
          <h2>
            vous pouvez naviguer sur ce site pour vous amuser et vous renseigner
            sur les maladies sexuellement transmisbiles.
